(function(a){Drupal.behaviors.ucProductFieldsetSummaries={attach:function(b){a("fieldset#edit-uc-product",b).drupalSetSummary(function(c){var d=[];a("input:checked",c).next("label").each(function(){d.push(Drupal.checkPlain(a(this).text()));});if(!a("#edit-uc-product-shippable",c).is(":checked")){d.unshift(Drupal.t("Not shippable"));}return d.join(", ");});a("fieldset.product-field",b).drupalSetSummary(function(c){var d=[];if(Drupal.checkPlain(a("#edit-model",c).val())){d.push(Drupal.t("SKU")+": "+Drupal.checkPlain(a("#edit-model",c).val()));}if(Drupal.checkPlain(a("#edit-sell-price",c).val())!="0"){d.push(Drupal.t("Sell price")+": "+a(".form-item-sell-price .field-prefix",c).html()+Drupal.checkPlain(a("#edit-sell-price",c).val())+a(".form-item-sell-price .field-suffix",c).html());}if(a("#edit-shippable",c).is(":checked")){d.push(Drupal.t("Shippable"));}else{d.push(Drupal.t("Not shippable"));}return d.join(", ");});}};})(jQuery);